import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1>UMC Study Plan</h1>
        <div className="number">
          <input id="input-box" placeholder="UMC 스터디 계획을 작성해보세요!"></input>
        </div>
      </div>
    </div>
  );
}

export default App;
